import { HamburgerIcon } from './svgs/HamburgerIcon';

export const Nav = () => {
    const navHeadings = ["About", "Knowledge", "Projects", "Contact"];
    return (
        <nav className="navbar" id="menu">
            {navHeadings.map((navHeading, i) => {
                const navRef = `#${navHeading.toLowerCase()}`
                return <a key={i} href={navRef}>{navHeading}</a>
            })}
            <a href="javascript:void(0);" className="ham-menu">
                <svg ariaHidden="true" focusable="false" dataPrefix="fas" dataIcon="bars" className="svg-inline--fa fa-bars fa-w-14" role="img" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 448 512">
                    <path fill="currentColor" d="M16 132h416c8.837 0 16-7.163 16-16V76c0-8.837-7.163-16-16-16H16C7.163 60 0 67.163 0 76v40c0 8.837 7.163 16 16 16zm0 160h416c8.837 0 16-7.163 16-16v-40c0-8.837-7.163-16-16-16H16c-8.837 0-16 7.163-16 16v40c0 8.837 7.163 16 16 16zm0 160h416c8.837 0 16-7.163 16-16v-40c0-8.837-7.163-16-16-16H16c-8.837 0-16 7.163-16 16v40c0 8.837 7.163 16 16 16z">
                    </path>
                </svg>
            </a>
        </nav>
    )
}
